  of Bottom Features from National Oceanic and Atmospheric Administration (NOAA) Survey
  H12007 and USGS Cruise 2011-006-FA in the Vicinity of Cross Rip Channel in Nantucket
  Sound, Offshore Southeastern Massachusetts (H12007_INTERP.SHP, Geographic, WGS84)\",\n\t\"tracking_summary\":
